class Solution:
    def validPalindrome(self, s: str) -> bool:
        if s == s[::-1]:
            return True
        i = 0
        j = len(s) - 1
        while i<=j:
            left = s[i]
            right = s[j]
            if left != right:
                temp1 = s[0:i] + s[i+1:]
                if temp1 == temp1[::-1]:
                    return True
                temp2 = s[0:j] + s[j+1:]
                if temp2 == temp2[::-1]:
                    return True
            i += 1
            j -= 1
        return False


s = ""
print(Solution().validPalindrome(s))